import React, { useState } from 'react';

function LogOut(props) {
    const [isLogOut, setisLogOut] = useState(
       false
    );
    function logout() {
        sessionStorage.clear();
        setisLogOut(true)
    }
    return (
        <div class='topright'>
            <a href="http://localhost:3000"><button class='other_buttons' onClick={logout}>
                LogOut
            </button></a>
        </div>

    );
}
export default LogOut
